import { Route } from 'react-router-dom';
import { Switch } from 'react-router-dom';
import Page1 from './pages/Page1';
import Page2 from './pages/Page2';


function App() {
  return (
    <div>
         <Switch>
          <Route path='/page1'>
           <Page1 />
          </Route>

            <Route>
             <Page2/>
            </Route>

         </Switch>
    </div>
  );
}

export default App;
